import React from 'react';

function ActionButton({ label, icon, altText, bgColor = "bg-blue-500", textColor = "text-white" }) {
  return (
    <button className={`flex gap-2 justify-center px-3 py-2 ${bgColor} ${textColor} rounded-xl`} aria-label={altText}>
      <div className="shrink-0 my-auto w-4 aspect-square">
        {icon}
      </div>
      <span>{label}</span>
    </button>
  );
}

export default ActionButton;
